import styled from 'styled-components';

export const MainContainer = styled.div`
  box-sizing: border-box;
  padding: 1rem;
  max-width: 500px;
  margin: 0 auto;
`;

export const MainInput = styled.input`
  box-sizing: border-box;
  width: 100%;
  padding: 1rem;
  font-size: 1rem;
`;
